import React from "react";
import "./address.css"; 
import Header from "../header/header";
import Footer from "../footer/Footer";

const Address = () => {
  return (

    <div className="addresses-page">
      <header className="header">
        <span className="back-arrow">‚Üê</span>
        <h1>Your Addresses</h1>
      </header>
      <div className="addresses-container">
        {/* Add Address Card */}
        <div className="address-card add-address">
          <div className="add-icon">+</div>
          <p>Add Address</p>
        </div>

        {/* Address Card 1 */}
        <div className="address-card">
          <h3>Mike Ross</h3>
          <p>45, Green Street, Sector 12,<br /> New Delhi, 110001, India</p>
          <p>Phone Number: 8734637468</p>
          <div className="address-footer">
            <span className="default-badge">Default</span>
            <div className="actions">
              <button>Edit</button> | <button>Remove</button>
            </div>
          </div>
        </div>

        {/* Address Card 2 */}
        <div className="address-card">
          <h3>Mike Ross</h3>
          <p>Office 704, Tower B, Techno Plaza,<br /> Bengaluru, Karnataka, 560100<br /> India</p>
          <p>Phone Number: 8937447362</p>
          <div className="actions">
            <button>Edit</button> | <button>Remove</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Address;
